import React from "react";
import styled, { ThemeProvider } from "styled-components";
import { Transition } from "arclight-react";

const Constraints = styled.div`
  position: relative;
  padding-top: 142.25%;
  width: 100%;
  overflow: hidden;
  font-size: 3vw;
`;

const Card = styled.div`
  & img {
    opacity: 1;
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
  }
`;

const Text = styled.div`
  position: absolute;
  bottom: 10px;
  right: 10px;
  font-weight: bold;
`;

export default class _ extends React.Component {
  render() {
    return (
      <ThemeProvider theme={{}}>
        <Transition>
          <Constraints>
            <Card>
              <img src={require("./img/yone.jpg")} height={"98%"} />
              <img src={require("../../../config/assets/border.png")} />
            </Card>
            <Text>Yone</Text>
          </Constraints>
        </Transition>
      </ThemeProvider>
    );
  }
}
